import React from 'react'
import './Product.css'
import Additems from './Additems'
import Subnav from '../Navbar/Subnav'
import Footer from '../Navbar/Footer'
import items from '../Data'

const Product = ({items}) => {
  return (
    <>
    <div>
      <Subnav/>
    </div>
     <div className="cantainer">
      <div className='row'>
      {items.map((item,i)=>{

return (
  <>
  <Additems key={i} id={item.id} category={item.category} title={item.title} description={item.description} imgSrc={item.imgSrc} price={item.price}/>
  </>
)
})}
      </div>
      </div> 
      <Footer/>
    </>
  )
}

export default Product
